// import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom'
import './App.css';
import Home from './pages/Home';
import View from './pages/View';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Switch>
          <Route path='/' component={Home}/>
          {/* <Route path='/view' element={<View/>}/> */}
        </Switch>
      </div>
    </BrowserRouter>  
  );
}

export default App;
